import react from './files/react.png';
import java from './files/java.png';
import python from './files/python.png';
import postgres from './files/PGLogo.png';
import c from './files/C.png';
import cpp from './files/C++.png';
import css from './files/css3.svg';
import html from './files/html.png';
import nginx from './files/nginx.svg';
import angular from './files/angular.png';
import bootstrap from './files/bootstrap.svg';

function Images(){
    return(
        <div>
            <img src={react} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={java} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={python} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={postgres} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={c} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={cpp} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={css} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={html} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={nginx} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={angular} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
            <img src={bootstrap} alt="" style={{"height" : "5%", "width" : "5%"}}></img>
        </div>
    );
}

export default Images;
